import Image from "../Banner.jfif";
import Card from "./Card";
import Useapi from "./Useapi";


function Locate(){

  const{data, error, loading} = Useapi('https://fakestoreapi.com/products');
  if(loading) return <h3>Loading......</h3>;

  if (error) return <h3>We know something went wrong, we are taking care of that.</h3>
  console.log (data[1].image);
  return(
    <><h1>data should load{data[1].image}</h1>
    <img src={data[1].image}></img>
    <Card
     image={data[1].image}
     title={data[1].title}
     price={data[1].price}   
    
    />
    </>
    
  )
  
}


function Main(){

  
    return (
      <div className="bdy">
      <div className='banner'>
        <img src={Image}></img>  
        </div>
        <Card />
        <Locate/>
      </div>
    
  
    )
  }

  export default Main;
